import React from 'react'
import Videoplay from './Videoplay'
import VideoFeed from './VideoFeed'
import Sidebar from '../Navbar/Sidebar'


const Video = ({ iisSidebarCollapsed, ionToggleSidebar }) => {
  const [Category, setCategory] = useState(0);
  return (
    
    <div className="flex flex-col lg:flex-row max-w mx-auto gap-6">
      {!iisSidebarCollapsed && <Sidebar isCollapsed={isSidebarCollapsed} Category= {Category} setCategory= {setCategory} />}
      
      <div className="lg:w-2/3">
        <Videoplay />
      </div>
      <div className="lg:w-1/3">
        <VideoFeed />
      </div>
    </div>
  )
}

export default Video
